import React from "react";
import { Router, Route, Switch, Redirect } from "react-router-dom";
import { createBrowserHistory } from "history";

import AdminLayout from "layouts/Admin.js";
import LoginLayout from "layouts/Login.js";
import ErrorLayout from "layouts/Error";
import WarningConfigHistoryLayout from "layouts/WarningConfigHistory";
import NotificationHistoryLayout from "layouts/NotificationHistory";
import ErrorBoundary from "common/ErrorBoundary";
import { configureHttp } from "axios/http/configure-http";

function App() {
  const hist = createBrowserHistory();
  //const loadingPage = document.getElementById("loading-page");

  //loadingPage.style.display = "none"

  
  configureHttp()

  return (
    <Router history={hist} forceRefresh>
      <ErrorBoundary>
        <Switch>
          <Route path="/login" render={props => <LoginLayout {...props} />} />
          <Route path="/admin" render={props => <AdminLayout {...props} />} />
          <Route path="/error" render={props => <ErrorLayout {...props} />} />
          <Route path="/warningconfig_history" render={props => <WarningConfigHistoryLayout {...props} />} />
          <Route path="/notification_history" render={props => <NotificationHistoryLayout {...props} />} />
          <Redirect to="/admin/tables" />
        </Switch>
      </ErrorBoundary>
    </Router>
  )
}

export default App
